  },
  {
   "cell_type": "markdown",
   "id": "f50ef9d2",
   "metadata": {
    "papermill": {
     "duration": 0.100663,
     "end_time": "2022-01-25T14:54:12.437328",
     "exception": false,
     "start_time": "2022-01-25T14:54:12.336665",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "In this particular project our business task to analyse the smart device usage data and come up with good recommendations that the BellaBeat marketing team can use to step up their marketing strategy.  \n",
    "The stakeholders involved in this project are:\n",
    "* Urška Sršen: Bellabeat's cofounder and Chief Creative Oﬃcer\n",
    "* Sando Mur: Mathematician and Bellabeat's cofounder\n",
    "* Bellabeat marketing analytics team\n"
   ]
  },
  {
