     "start_time": "2022-01-25T14:54:12.932934",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "Let us consider some limitations of the data we are using.  \n",
    "* The dataset is not substantial enough for us to draw good conclusions\n",
    "* The dataset did not exactly specify the genders of the individuals involved in the analysis so we are just assuming that they are females\n",
    "* The dataset does not specify the exact location of the participants "
   ]
